import React from 'react';
import { Container, Jumbotron } from 'react-bootstrap';

const Dashboard = () => {
  return (
    <Container className="mt-5">
      <Jumbotron>
        <h1>Welcome to the Dashboard!</h1>
        <p>This is a general dashboard for all users.</p>
      </Jumbotron>
    </Container>
  );
};

export default Dashboard;
